import React from 'react';


const CardDetails = ({ card }) => {
console.log(card)

  return(
    <section>
      <span>{ `Detalhes do repositório ${card.name}`}</span>
      <br></br>
      <span>{`Quantidade de forks: ${card.forks}`}</span>
      <br></br>
      <span>{ `Criado em`}</span>

    </section>

  )
}

export  default CardDetails;
